import {NavLink }  from  "react-router-dom";

function Navbar(){
    const navigator = [
        { name:"name" ,href:"#", current:true},
        { name:"name" ,href:"#", current:true},
        { name:"name" ,href:"#", current:true},
        { name:"name" ,href:"#", current:true},
    ]
    return(
         <header>
                <div className="Logo">
                      <span>sneakers</span>
                </div>
                <nav className="menu">
                           {
                               navigator.map((navLink)=>{
                                      
                                     return (   <NavLink  
                                              to={navLink.href}
                                               className ={(isActive=>{
                                                    return  isActive ? "text-orange" :  "text-dark"
                                               })}
                                        
                                        >
                                            {navLink.name}
                                         </NavLink>
                                     )
                                     
                               })
                           }
                </nav>

         </header>
    )

}

export default Navbar;
